// src/components/SpecificPlacesMap.jsx
import React, { useState, useEffect } from "react";
import { GoogleMap, useLoadScript, Marker } from "@react-google-maps/api";
import "./SpecificPlaces.css";

const mapContainerStyle = {
  width: "100%",
  height: "400px",
};

const SpecificPlacesMap = ({ travelData }) => {
  const [placeCoordinates, setPlaceCoordinates] = useState([]);
  const [center, setCenter] = useState({ lat: 0, lng: 0 });

  const { isLoaded, loadError } = useLoadScript({
    googleMapsApiKey: process.env.REACT_APP_GOOGLE_MAPS_API_KEY,
    libraries: ["places"],
  });

  useEffect(() => {
    if (!isLoaded || !travelData?.generatedItinerary) return;

    const geocoder = new window.google.maps.Geocoder();
    const coordinates = [];
    let resultsCount = 0;

    const itineraryPlaces = Array.isArray(travelData.generatedItinerary)
      ? travelData.generatedItinerary
      : [];

    // Replace "The Republic of Užupis" with dynamic generated itinerary places
    const finalPlaces = [
      ...itineraryPlaces,
      "Gediminas' Tower",
      "Vilnius Old Town",
    ];

    finalPlaces.forEach((place) => {
      geocoder.geocode({ address: place }, (results, status) => {
        if (status === "OK" && results[0]) {
          const location = results[0].geometry.location;
          coordinates.push({
            name: place,
            lat: location.lat(),
            lng: location.lng(),
          });
          resultsCount++;
          if (resultsCount === finalPlaces.length) {
            setPlaceCoordinates(coordinates);
            setCenter({
              lat: coordinates[0].lat,
              lng: coordinates[0].lng,
            });
          }
        }
      });
    });
  }, [isLoaded, travelData]);

  if (loadError) return <div>Error loading maps</div>;
  if (!isLoaded) return <div>Loading maps...</div>;

  return (
    <div className="specific-places-container">
      <div className="travel-data">
        <h2>Travel Plan Details</h2>
        <div className="data-item">
          <strong>Current City:</strong> {travelData.currentCity}
        </div>
        <div className="data-item">
          <strong>Destination:</strong> {travelData.destination}
        </div>
        <div className="data-item">
          <strong>Days:</strong> {travelData.days}
        </div>
        {travelData.generatedItinerary && (
          <div className="data-item">
            <strong>Generated Itinerary:</strong>
            <ul>
              {travelData.generatedItinerary.map((place, index) => (
                <li key={index}>{place}</li>
              ))}
            </ul>
          </div>
        )}
      </div>

      <GoogleMap mapContainerStyle={mapContainerStyle} zoom={8} center={center}>
        {placeCoordinates.map((place, index) => (
          <Marker
            key={index}
            position={{ lat: place.lat, lng: place.lng }}
            label={place.name}
          />
        ))}
      </GoogleMap>

      <div style={{ marginTop: "20px" }}>
        <h2>Specific Places</h2>
        <ul>
          {placeCoordinates.map((place, index) => (
            <li key={index}>
              <strong>{place.name}</strong>
              <p>
                Lat: {place.lat.toFixed(4)}, Lng: {place.lng.toFixed(4)}
              </p>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default SpecificPlacesMap;
